-- ----------------------------
-- Table structure for task_item
-- ----------------------------
DROP TABLE IF EXISTS `task_item`;
CREATE TABLE `task_item` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '子任务唯一标识',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '父任务id',
  `services_id` bigint(20) DEFAULT NULL COMMENT '服务id',
  `task_ip` json DEFAULT NULL COMMENT '服务ip',
  `task_git` varchar(255) DEFAULT NULL COMMENT 'git仓库地址',
  `now_version` varchar(255) DEFAULT NULL COMMENT '本次提交的commidId',
  `base_version` varchar(255) DEFAULT NULL COMMENT '比较的基准commitId',
  `status` tinyint(4) DEFAULT NULL COMMENT '任务状态 0任务未开始 1下载代码 2编译 3codediff 4生成exec文件 5生成报告 6报告已完成 -1执行异常',
  `task_file` varchar(255) DEFAULT NULL COMMENT 'minio文件名称',
  `row_cov` double DEFAULT NULL COMMENT '行覆盖率',
  `function_cov` double DEFAULT NULL COMMENT '方法覆盖率',
  `branch_cov` double DEFAULT NULL COMMENT '分支覆盖率',
  `err_msg` varchar(500) DEFAULT NULL COMMENT '错误信息',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `finish_time` timestamp NULL DEFAULT NULL COMMENT '完成时间',
  `create_user` varchar(255) DEFAULT NULL COMMENT '创建人工号',
  `is_deleted` tinyint(4) DEFAULT '0' COMMENT '删除标识  0未删除  1已删除',
  `diff_methods` text COMMENT '增量代码信息',
  `base_version_id` bigint(20) DEFAULT NULL COMMENT '基线版本id',
  `now_version_id` bigint(20) DEFAULT NULL COMMENT '当前版本id',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=697 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='覆盖率任务子表';

