-- ----------------------------
-- Table structure for versions
-- ----------------------------
DROP TABLE IF EXISTS `versions`;
CREATE TABLE `versions` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '版本唯一标识',
  `project_id` varchar(255) DEFAULT NULL COMMENT '项目id',
  `version_name` varchar(255) NOT NULL COMMENT '版本名称',
  `version_number` varchar(255) DEFAULT NULL COMMENT '版本号',
  `version_desc` varchar(255) DEFAULT NULL COMMENT '版本描述',
  `version_branch` varchar(255) DEFAULT NULL COMMENT '分支',
  `service_list` json DEFAULT NULL COMMENT '服务列表',
  `services_desc` longtext COMMENT '服务ip和对应agent端口',
  `parent_version` varchar(255) DEFAULT NULL COMMENT '父版本',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `create_user` varchar(255) DEFAULT NULL COMMENT '创建人工号',
  `update_user` varchar(255) DEFAULT NULL COMMENT '更新人工号',
  `is_deleted` tinyint(4) DEFAULT '0' COMMENT '删除标识  0未删除  1已删除',
  `is_upload` tinyint(4) DEFAULT '1' COMMENT '1 定时更新exec文件  0 不更新',
  `upload_time` timestamp NULL DEFAULT NULL COMMENT '最近一次更新exec文件的时间',
  `top_flag` tinyint(4) DEFAULT '0' COMMENT '1置顶 0默认',
  `artifact_info` json DEFAULT NULL COMMENT '制品信息',
  `version_type` tinyint(4) DEFAULT '0' COMMENT '1发行版 0过程版，默认0',
  `release_version` json DEFAULT NULL COMMENT '发行版服务对应的当前版本，服务ID：版本ID',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `project_id_is_deleted_index` (`project_id`,`is_deleted`,`parent_version`) COMMENT 'version list查询'
) ENGINE=InnoDB AUTO_INCREMENT=218 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='版本表';

